import axios from "axios";
import React, { useState } from "react";
import { apiUrl } from "../axios";
import { useNavigate } from "react-router-dom";

export default function Register() {
  const [formValues, setFormValues] = useState({
    first_name: "",
    last_name: "",
    username: "",
    email: "",
    password: "",
    confirm_password: ""
  });
  const [errors, setErrors] = useState({});
  
  const navigate = useNavigate();

  const onChangeHandler = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });

    // Password confirmation validation
    if (name === "confirm_password" && value !== formValues.password) {
      setErrors((prevErrors) => ({ ...prevErrors, password: "*Passwords do not match" }));
    } else {
      setErrors((prevErrors) => ({ ...prevErrors, password: "" }));
    }
  };

  const handleRegister = (e) => {
    e.preventDefault();
    
    // Validate passwords before sending
    if (formValues.password !== formValues.confirm_password) {
      setErrors((prevErrors) => ({ ...prevErrors, password: "*Passwords do not match" }));
      return;
    }

    userRegister();
  };

  // Register user
  const userRegister = async () => {
    await axios
      .post(apiUrl + "/medical_store_app/user/", formValues)
      .then((response) => {
        if (response.status === 201) {
          alert("Registration successful!");
          navigate("/login");
        }
      })
      .catch((error) => {
        // Handling specific errors returned from the API
        setErrors((prevErrors) => ({ 
          ...prevErrors, 
          api: error.response?.data?.message || "Registration failed" 
        }));
        console.log(error);
      });
  };

  // Inline CSS styles
  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
      height: "100vh",
      backgroundColor: "#f4f4f4",
    },
    form: {
      background: "#fff",
      padding: "16px",
      borderRadius: "5px",
      boxShadow: "0 2px 5px rgba(0,0,0,0.2)",
      width: "300px",
      textAlign: "center",
    },
    label: {
      display: "block",
      marginBottom: "8px",
      fontWeight: "bold",
    },
    input: {
      width: "100%",
      padding: "6px",
      marginBottom: "15px",
      border: "1px solid #ccc",
      borderRadius: "4px",
    },
    errorText: {
      color: "red",
      fontSize: "12px",
      marginBottom: "15px",
    },
    button: {
      width: "100%",
      padding: "9px",
      backgroundColor: "#28a745",
      color: "#fff",
      border: "none",
      borderRadius: "4px",
      cursor: "pointer",
      fontWeight: "bold",
    },
  };

  return (
    <div style={styles.container}>
      <h2>User Registration</h2>
      <form style={styles.form} onSubmit={handleRegister}>
        <div>
          <label style={styles.label}>
            First Name:
            <input
              type="text"
              name="first_name"  // Changed to match the backend key
              value={formValues.first_name}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Last Name:
            <input
              type="text"
              name="last_name"  // Changed to match the backend key
              value={formValues.last_name}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Username:
            <input
              type="text"
              name="username"
              value={formValues.username}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Email:
            <input
              type="email"
              name="email"
              value={formValues.email}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
            {errors.email && <p style={styles.errorText}>{errors.email}</p>}
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Password:
            <input
              type="password"
              name="password"
              value={formValues.password}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Confirm Password:
            <input
              type="password"
              name="confirm_password"  // Changed to match the formValues key
              value={formValues.confirm_password}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
            {errors.password && <p style={styles.errorText}>{errors.password}</p>}
          </label>
        </div>
        {errors.api && <p style={styles.errorText}>{errors.api}</p>}
        <button type="submit" style={styles.button}>Register</button>
      </form>
    </div>
  );
}
